import React, { Component } from 'react'

class Form extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             username: '',
             comments: '',
             topic: 'react'
        }
    }

    
  render() {
    return (
      <div>
        <form>
          <div>
            <label>Username</label>
            <input type="text" />
          </div>
          {/* <button type="submit">Submit</button> */}
        </form>
      </div>
    )
  }
}

export default Form
